// ==UserScript==
// @name One More Baseball Script by Kosonome
// @namespace koso.com.br
// @version 0.5.1
// @include http*://politicsandwar.com/obl/*
// @require https://code.jquery.com/jquery-3.5.1.min.js
// @require https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.12.9/umd/popper.min.js
// @description This baseball script is for playing away games, hosting games and track money for tips in PnW's baseball.
// @downloadURL https://update.greasyfork.org/scripts/393454/One%20More%20Baseball%20Script%20by%20Kosonome.user.js
// @updateURL https://update.greasyfork.org/scripts/393454/One%20More%20Baseball%20Script%20by%20Kosonome.meta.js
// ==/UserScript==

/**
 * FEATURES FOR BASEBALL HOSTING:
 *
 * 1) When clicking in a bigger "Host Game Button", the button will be disabled, and you will not need to refresh your page.
 * It will do the hard work of refreshing in background and check if your baseball host game is already finished. After finishing
 * this game, it will play a sound and enable the "Host Game Button" again for clicking. IT WILL NOT CLICK FOR YOU.
 *
 * 2) If for some reason you get a captcha, it will play a different sound and redirect you to the captcha.
 *
 * 3) If you start playing a home game, and leave the page or close the browser, and returning to that baseball page afterwards,
 * the program will check if you are still playing that host game or not. If yes, the button will be disabled and will start refreshing
 * for you. If no, the next time that you play a home game and finish that game, it will add 2 tips, the one that you played right
 * now, and the one when you closed the browser.
 *
 * 4) All the games played will be added to a table containing the 30% tips. Those 30% tips are only the hosting money, not the winning
 * money. In that table, there is a button for change the money, in case of you paying parcially that player tips, and there is a remove
 * button. You can wipe all table info by pressing "Reset Tips Table" also.
 *
 * 5) When showing "Send", it means you need to send that amount of money as 30% tips to that nation. The trade is manual.
 */

/**
 * FEATURES FOR BASEBALL PLAY AWAY GAMES:
 *
 * 1) When clicking in a bigger "Play Away Game", the button will be disabled, and you will not need to refresh your page.
 * It will do the hard work of refreshing in background and check if there is a game to be played. When there is a game to be played,
 * the button will re-enable for clicking again. IT WILL NOT CLICK FOR YOU.
 *
 * 2) If for some reason you get a captcha, it will play a different sound and redirect you to the captcha.
 *
 * 3) If you start playing a away game, and leave the page or close the browser before finishing the tips calculation, and returning
 * to that baseball page afterwards, the program will calculate all past games that wasn't calculated it.
 *
 * 4) All the games played will be added to a table containing the 30% tips. Those 30% tips are only the hosting money, not the winning
 * money. In that table, there is a button for change the money, in case of you paying parcially that player tips, and there is a remove
 * button. You can wipe all table info by pressing "Reset Tips Table" also.
 *
 * 5) When showing "Receive", it means you need to receive that amount of money from that nation as tips.
 */

(function(){

    var $ = window.jQuery;
    const VERSION = '0.5.0';

    // general helper functions
    var HELPER = new HelperFunctions();

    // database functions to deal with localStorage
    var DB = new Database();

    // helper functions to create html table with localStorage for both Away and Home pages
    var TIPS_TABLE = new TipsTable(DB);

    // extract html pages info functions
    var PAGE_QUERY = new PageQuery();

    const SOUNDS = {
        ELETRONIC_CHIME: new Audio('data:audio/mpeg;base64,'),
        A_TONE: new Audio('data:audio/mpeg;base64,')
    };

    $(function() {
        baseballHost();
        baseballAway();
    });

    function baseballHost() {
        const ELEMENTS = {
            HOST_BUTTON: '#rightcolumn input[value="Host Home Game"]',
            CANCEL_HOST_BUTTON: '#rightcolumn input[value="Cancel Home Game"]',
            NEW_HOST_BUTTON: '#ajax-host-button',
            NEW_CANCEL_BUTTON: '#ajax-cancel-button',
            BACK_BUTTON: '#rightcolumn p a:contains("Back to Team")',
            ALERT_BASEBALL: '#info-baseball',
            BASEBALL_CONTAINER: '#rightcolumn',
            ALERT_DANGER_BASEBALL: '#rightcolumn form div.alert.alert-danger'
        };

        // start visual aid //
        var hostButton = $(ELEMENTS.HOST_BUTTON);
        var cancelHostButton = $(ELEMENTS.CANCEL_HOST_BUTTON);

        if (!hostButton.length && !cancelHostButton.length) {
            // i'm not in the host button page or cancel host button page
            return;
        }

        // add buttons and html table
        addHtmlElements();

        // sort of global var for token
        var tokenVal = $('#rightcolumn input[name="token"]').val();

        if (cancelHostButton.length) {
            waitForHostGameFinish(false);
        }

        // don't reload the page once you click host game, make a AJAX call instead
        $(ELEMENTS.NEW_HOST_BUTTON).click(event => waitForHostGameFinish(true));
        $(ELEMENTS.NEW_CANCEL_BUTTON).click(event => sendCancelAndRefresh());

        // only functions for host now now //
        function addHtmlElements() {
            // hide buttons and alerts
            $(ELEMENTS.HOST_BUTTON).hide();
            $(ELEMENTS.CANCEL_HOST_BUTTON).hide();
            $(ELEMENTS.ALERT_DANGER_BASEBALL).hide();

            var container = $(ELEMENTS.BASEBALL_CONTAINER);
            container.addClass('center');

            // create own host button
            var hostButton = `<button type="button" id="${ELEMENTS.NEW_HOST_BUTTON.replace('#', '')}" class="btn btn-primary"
              style="font-size: 30px; width: 300px; margin-top: 20px;">Host Home Game</button>`;
            container.append(hostButton);

            // didn't worked yet
            var cancelHostButton = `<button type="button" id="${ELEMENTS.NEW_CANCEL_BUTTON.replace('#', '')}" class="btn btn-danger btn-sm" disabled
              style="display: none; margin: 44px 0 0 5px;">Cancel</button>`;
            container.append(cancelHostButton);

            var notPlayingAnyHostGame = 'Not playing any host game...';
            var alertHtml = `<div id="${ELEMENTS.ALERT_BASEBALL.replace('#', '')}" class="alert alert-info bold" style="margin-top: 20px;">${notPlayingAnyHostGame}</div>`;
            container.append(alertHtml);

            var tipTableHtml = '<hr/>' + TIPS_TABLE.htmlTipsTable();
            container.append(tipTableHtml);
            TIPS_TABLE.eventsAfterAppend();
        }

        async function sendCancelAndRefresh() {
            try {
                $(ELEMENTS.NEW_CANCEL_BUTTON).prop('disabled', true);
                await PAGE_QUERY.cancelHostGame(tokenVal);
            } finally {
                // even with errors or success, refresh page
                location.reload();
            }
        }

        async function waitForHostGameFinish(playAudio) {
            $(ELEMENTS.NEW_HOST_BUTTON).prop('disabled', true);
            $(ELEMENTS.NEW_CANCEL_BUTTON).prop('disabled', false);

            var waitingHostGameText = 'Waiting for host game finish. Refreshed already %s times.';
            var counterRefreshes = 0;
            var pageHostGameHtml = null;

            try {
                pageHostGameHtml = await PAGE_QUERY.playHostGame(tokenVal);
                $(ELEMENTS.ALERT_BASEBALL).text(waitingHostGameText.replace('%s', counterRefreshes));
            } catch (error) {
                $(ELEMENTS.ALERT_BASEBALL).text('Failed to host game, try again.');
                $(ELEMENTS.NEW_HOST_BUTTON).prop('disabled', false);
                $(ELEMENTS.NEW_CANCEL_BUTTON).prop('disabled', true);
                return;
            }

            // retry until you can host again
            var resultExtractHome = {
                tryAgain: true,
                htmlText: pageHostGameHtml
            };

            do {
                try {
                    resultExtractHome = await PAGE_QUERY.verifyHostGame(resultExtractHome.htmlText, playAudio);
                    $(ELEMENTS.ALERT_BASEBALL).text(waitingHostGameText.replace('%s', ++counterRefreshes));
                    await HELPER.timeout(1000);
                } catch (error) {
                    $(ELEMENTS.ALERT_BASEBALL).text('Failed to connect to host page, trying again in 10 seconds...');
                    await HELPER.timeout(10000);
                }
            } while(resultExtractHome.tryAgain);

            // it will start calculate results soon, so there is no need to cancel host game
            $(ELEMENTS.NEW_CANCEL_BUTTON).prop('disabled', true);

            // retry until you can read all matchs in history match page
            $(ELEMENTS.ALERT_BASEBALL).text('Grabbing information to calculate tips... [history match page]');

            var resultExtractHistory = {
                tryAgain: true,
                matchIds: []
            };

            // grabbing your team ID here, extracting from "back to team" button
            var hrefBackButton = $(ELEMENTS.BACK_BUTTON).attr('href');
            var teamId = hrefBackButton.match(/\d+/g)[0];

            do {
                try {
                    resultExtractHistory = await PAGE_QUERY.historyMatches(teamId, DB.getLastMatchId(), playAudio);
                } catch(error) {
                    $(ELEMENTS.ALERT_BASEBALL).text('Failed to connect to history match page, trying again in 10 seconds...');
                    await HELPER.timeout(10000);
                }
            } while(resultExtractHistory.tryAgain);

            // retry until it can read each one of matches in matchIds array
            $(ELEMENTS.ALERT_BASEBALL).text('Grabbing information to calculate tips... [match earnings pages]');

            var matchInfosExtracted = [];

            do {
                var firstMatchObj = resultExtractHistory.matchIds.shift();

                try {
                    var matchInfo = await PAGE_QUERY.matchEarnings(firstMatchObj, playAudio);
                    matchInfosExtracted.push(matchInfo);
                } catch(error) {
                    $(ELEMENTS.ALERT_BASEBALL).text('Failed to connect to a match earnings page, trying again in 10 seconds...');
                    resultExtractHistory.matchIds.unshift(firstMatchObj);
                    await HELPER.timeout(10000);
                }
            }
            while(resultExtractHistory.matchIds.length > 0);

            // now we gonna check nation name and his alliance name for each item on matchInfosExtracted array
            $(ELEMENTS.ALERT_BASEBALL).text('Grabbing information to calculate tips... [nation pages]');

            for (var i = 0; matchInfosExtracted.length > i; i++) {
                try {
                    matchInfosExtracted[i] = await PAGE_QUERY.nationInfo(matchInfosExtracted[i]);

                    if (DB.getLastMatchId() < matchInfosExtracted[i].matchId) {
                        // we didn't add that to dabatase yet
                        DB.addTipsInfo(matchInfosExtracted[i]);
                    }
                } catch(error) {
                    $(ELEMENTS.ALERT_BASEBALL).text('Failed to connect to a nation page, trying again in 10 seconds...');

                    // stay in same element for trying again
                    i--;

                    await HELPER.timeout(10000);
                }
            }

            // everything is okay, let's enable button again!
            if (playAudio) {
                // Sounds that does not trigger with a user interaction (click, etc), gets blocked by default, and throwing errors.
                SOUNDS.A_TONE.play();
            }

            // grabbing token from that page
            tokenVal = PAGE_QUERY.getTokenFromPage(resultExtractHome.htmlText);

            TIPS_TABLE.reloadTipsTable();

            $(ELEMENTS.NEW_HOST_BUTTON).removeAttr('disabled');
            $(ELEMENTS.ALERT_BASEBALL).text('Host game finished. Click home button again!');
        }
    }

    function baseballAway() {
        const ELEMENTS = {
            PLAY_AWAY_BUTTON: '#rightcolumn input[value="Play Away Game"]',
            NEW_PLAY_AWAY_BUTTON: '#play-away-button',
            BASEBALL_CONTAINER: '#rightcolumn',
            ALERT_BASEBALL: '#info-baseball',
            ALERT_BASEBALL_AWAY: '#rightcolumn div.alert.alert-danger',
            REFRESH_LINK_AWAY: '#rightcolumn a:contains("Refresh")',
            BACK_BUTTON: '#rightcolumn p a:contains("Back to Team")'
        };

        // start visual aid //
        var awayButton = $(ELEMENTS.PLAY_AWAY_BUTTON);
        var refreshLink = $(ELEMENTS.REFRESH_LINK_AWAY);

        if (!awayButton.length && !refreshLink.length) {
            // i'm not in the away button page
            return;
        }

        var thisPageHtmlText = $('html')[0].outerHTML;

        // add buttons and html table
        addHtmlElements();

        // sort of global var for token
        var tokenVal = PAGE_QUERY.getTokenFromPage(thisPageHtmlText);

        // don't reload the page once you click play away game, make a AJAX call instead
        $(ELEMENTS.NEW_PLAY_AWAY_BUTTON).click(function(event) {
            event.preventDefault();
            executeAwayGame(thisPageHtmlText, true);
        });

        // only functions now //
        function addHtmlElements() {
            // hide buttons and alerts
            $(ELEMENTS.PLAY_AWAY_BUTTON).hide();
            $(ELEMENTS.ALERT_BASEBALL_AWAY).hide();
            $(ELEMENTS.REFRESH_LINK_AWAY).hide();

            var container = $(ELEMENTS.BASEBALL_CONTAINER);
            container.addClass('center');

            // create own play button
            var playButton = `<button type="button" id="${ELEMENTS.NEW_PLAY_AWAY_BUTTON.replace('#', '')}" class="btn btn-primary"
              style="font-size: 30px; width: 300px; margin-top: 20px;">Play Away Game</button>`;
            container.append(playButton);

            var currentGames = PAGE_QUERY.checkCurrentGamesNumber(thisPageHtmlText);

            var currentGamesText = 'There are currently %s matches available.';
            var alertHtml = '<div id="' + ELEMENTS.ALERT_BASEBALL.replace('#', '') + '" class="alert alert-info bold" style="margin-top: 20px;">' + currentGamesText.replace('%s', currentGames) + '</div>';
            container.append(alertHtml);

            var tipTableHtml = '<hr/>' + TIPS_TABLE.htmlTipsTable();
            container.append(tipTableHtml);
            TIPS_TABLE.eventsAfterAppend();

            if (currentGames == 0) {
                $(ELEMENTS.NEW_PLAY_AWAY_BUTTON).attr('disabled', true);

                // since there is no games, lets start refreshing until there is a game
                executeAwayGame(thisPageHtmlText, false);
            }
        }

        async function executeAwayGame(htmlAwayPage, playAudio) {
            // disable to prevent more clicks
            $(ELEMENTS.NEW_PLAY_AWAY_BUTTON).attr('disabled', true);

            // make post to page simulating a click
            try {
                var newHtmlAwayPage = await PAGE_QUERY.playAwayGame(tokenVal);
            } catch (error) {
                $(ELEMENTS.ALERT_BASEBALL).text('Failed to connect to play away game page, try again.');
                $(ELEMENTS.NEW_PLAY_AWAY_BUTTON).removeAttr('disabled');
                return;
            }

            // retry until there is play away games available
            var resultExtractAway = {
                tryAgain: true, // its true when there is no games to play
                tokenVal: null,
                htmlText: newHtmlAwayPage,
                gamesQuantity: 0,
                isGamePlayed: false // its true when after playing away game, it got money earning results
            };

            var counterRefreshes = 0;
            var waitingAwayGameText = 'No games found. Refreshed already %s times to find a game.';

            do {
                try {
                    resultExtractAway = await PAGE_QUERY.verifyAwayGame(resultExtractAway.htmlText, playAudio);

                    // current game found! make calculations to tips table
                    if (resultExtractAway.isGamePlayed) {
                        counterRefreshes = 0;
                        await extractGameEarnings(resultExtractAway.htmlText, playAudio);
                    }

                    // there is not more away games, so we need to refresh page
                    if (resultExtractAway.tryAgain) {
                        $(ELEMENTS.ALERT_BASEBALL).text(waitingAwayGameText.replace('%s', ++counterRefreshes));
                        await HELPER.timeout(1000);
                    }
                } catch (error) {
                    $(ELEMENTS.ALERT_BASEBALL).text('Failed to connect to away game page, trying again in 10 seconds...');
                    await HELPER.timeout(10000);
                }
            } while(resultExtractAway.tryAgain);

            // if its here, there is a game that we can click!
            tokenVal = resultExtractAway.tokenVal;

            // only play audio if the action was from an user interaction (browser security will make errors otherwise)
            if (playAudio) {
                SOUNDS.A_TONE.play();
            }

            var currentGamesText = 'There are %s away games to be played.';
            $(ELEMENTS.ALERT_BASEBALL).text(currentGamesText.replace('%s', resultExtractAway.gamesQuantity));
            $(ELEMENTS.NEW_PLAY_AWAY_BUTTON).removeAttr('disabled');
        }

        async function extractGameEarnings(htmlAwayPage, playAudio) {
            $(ELEMENTS.ALERT_BASEBALL).text('Grabbing information to calculate tips... [history match page]');

            var elementLink = $($.parseHTML(htmlAwayPage)).find(ELEMENTS.BACK_BUTTON);

            // retry until we have all the matchIds played
            var resultExtractHistory = {
                tryAgain: true,
                matchIds: []
            };

            // grabbing your team ID here, extracting from "back to team" button
            var hrefBackButton = elementLink.attr('href');
            var teamId = hrefBackButton.match(/\d+/g)[0];

            do {
                try {
                    resultExtractHistory = await PAGE_QUERY.historyMatches(teamId, DB.getLastMatchId(), playAudio);
                } catch(error) {
                    $(ELEMENTS.ALERT_BASEBALL).text('Failed to connect to history match page, trying again in 10 seconds...');
                    await HELPER.timeout(10000);
                }
            } while(resultExtractHistory.tryAgain);

            // retry until it can read each one of matches in matchIds array
            $(ELEMENTS.ALERT_BASEBALL).text('Grabbing information to calculate tips... [match earnings pages]');

            var matchInfosExtracted = [];

            do {
                var firstMatchObj = resultExtractHistory.matchIds.shift();

                try {
                    var matchInfo = await PAGE_QUERY.matchEarnings(firstMatchObj, playAudio);
                    matchInfosExtracted.push(matchInfo);
                } catch(error) {
                    $(ELEMENTS.ALERT_BASEBALL).text('Failed to connect to a match earnings page, trying again in 10 seconds...');
                    resultExtractHistory.matchIds.unshift(firstMatchObj);
                    await HELPER.timeout(10000);
                }
            } while(resultExtractHistory.matchIds.length > 0);

            // now we gonna check nation name and his alliance name for each item on matchInfosExtracted array
            $(ELEMENTS.ALERT_BASEBALL).text('Grabbing information to calculate tips... [nation pages]');

            for (var i = 0; matchInfosExtracted.length > i; i++) {
                try {
                    matchInfosExtracted[i] = await PAGE_QUERY.nationInfo(matchInfosExtracted[i]);

                    if (DB.getLastMatchId() < matchInfosExtracted[i].matchId) {
                        // we didn't add that to dabatase yet
                        DB.addTipsInfo(matchInfosExtracted[i]);
                    }
                } catch(error) {
                    $(ELEMENTS.ALERT_BASEBALL).text('Failed to connect to a nation page, trying again in 10 seconds...');

                    // stay in same element for trying again
                    i--;

                    await HELPER.timeout(10000);
                }
            }

            TIPS_TABLE.reloadTipsTable();
        }

    }

    function TipsTable(databaseObject) {
        var database = databaseObject;

        const ELEMENTS = {
            TIPS_CONTAINER: '#tips-container',
            RESET_TIPS_BUTTON: '#reset-tips',
            HIGHLIGHT_ALLIANCE_IDS_BUTTON: '#highlight-alliances'
        };

        this.htmlTipsTable = htmlTipsTable;
        this.reloadTipsTable = reloadTipsTable;
        this.eventsAfterAppend = eventsAfterAppend;

        function reloadTipsTable() {
            // remove all html data first
            var elementTable = $(ELEMENTS.TIPS_CONTAINER + ' table');
            elementTable.html('');
            elementTable.append('<tr><td><b>Nation <a href="#" id="sort-nations-name"></a></b></td><td><b>Alliance <a href="#" id="sort-alliance-name"></a></b></td><td><b>Money (30%) <a href="#" id="sort-money-name"></a></b></td><td><b>Options</b></td></tr>');

            if (database.getTipsInfo().length === 0) {
                var noTipsOnTable = 'There is no tips right now, play some games.';
                elementTable.append('<tr><td colspan="4" style="text-align: center;"><small>' + noTipsOnTable + '</small></td></tr>');
                return;
            }

            var eventClickMoneyChange = function(event) {
                event.preventDefault();
                var moneySubtract = parseFloat(window.prompt('How much money do you want to SUBTRACT from that nation?'));
                var nationId = $(this).attr('data-nation-id');

                if (isNaN(moneySubtract)) {
                    alert('The money for that nation was not changed.');
                    return;
                }

                database.addNationTips(nationId, -moneySubtract);
                reloadTipsTable();
            };

            var eventClickNationRemove = function(event) {
                event.preventDefault();
                var nationId = $(this).attr('data-nation-id');
                database.removeNationTips(nationId);
                reloadTipsTable();
            };

            var eventClickSortNationName = function(event) {
                event.preventDefault();
                database.setConfigSortTableTips('nationName');
                reloadTipsTable();
            };

            var eventClickSortMoney = function(event) {
                event.preventDefault();
                database.setConfigSortTableTips('money');
                reloadTipsTable();
            };

            var eventClickSortAllianceName = function(event) {
                event.preventDefault();
                database.setConfigSortTableTips('allianceName');
                reloadTipsTable();
            };

            var arrayTips = database.getTipsInfo();

            var orderingTableFromDatabase = databaseObject.getConfigSortTableTips();

            if (orderingTableFromDatabase == 'money') {
                arrayTips.sort((a, b) => a.moneyDeserved - b.moneyDeserved);
            }

            if (orderingTableFromDatabase == 'nationName') {
                arrayTips.sort((a, b) => a.nationName > b.nationName ? 1 : -1);
            }

            if (orderingTableFromDatabase == 'allianceName') {
                arrayTips.sort((a, b) => a.allianceName > b.allianceName ? 1 : -1);
            }

            var highlightAlliances = database.getHighligthAllianceIds();

            arrayTips.forEach(function(tipItem) {
                var buttonMoneyChange = '<button type="button" class="btn btn-success btn-xs money-change" data-nation-id="' + tipItem.nationId + '">Money Change</button>';
                var buttonExcludeNation = '<button type="button" class="btn btn-danger btn-xs nation-remove" data-nation-id="' + tipItem.nationId + '" style="margin-left: 20px;">Remove</button>';

                var titleHelp = tipItem.moneyDeserved > 0 ? 'You will receive a trade from that player with somewhat that amount of money.' : 'You need receive that amount money from that player, so make a trade with him.';
                var badgeHtml = '<span class="badge" title="' + titleHelp + '">' + ( tipItem.moneyDeserved > 0 ? 'Send' : 'Receive' ) + '</span> ';
                var moneyDeservedToNation = badgeHtml + (Math.abs(tipItem.moneyDeserved)).toLocaleString();

                var findAllyId = highlightAlliances.find(allyId => allyId == tipItem.allianceId);

                var starHighlight = findAllyId ? '<span class="glyphicon glyphicon-star"></span> ' : '';

                var tableRow = '<tr><td><a href="/nation/id=' + tipItem.nationId + '">' + tipItem.nationName + '</a></td><td>' + starHighlight;
                tableRow += tipItem.allianceName + '</td><td>' + moneyDeservedToNation + '</td><td style="width: 200px;">' + buttonMoneyChange + buttonExcludeNation + '</td></tr>';

                elementTable.append(tableRow);
            });

            // give all buttons with class money-change the same click function
            elementTable.find('button.money-change').click(eventClickMoneyChange);

            // give all buttons with class nation-remove the same click function
            elementTable.find('button.nation-remove').click(eventClickNationRemove);

            // give sort links the click event
            elementTable.find('a#sort-nations-name').click(eventClickSortNationName);
            elementTable.find('a#sort-money-name').click(eventClickSortMoney);
            elementTable.find('a#sort-alliance-name').click(eventClickSortAllianceName);
            elementTable.find('a#sort-nations-name, a#sort-money-name, a#sort-alliance-name').css('text-decoration', 'none');
        }

        // returns HTML table
        function htmlTipsTable() {
            var tableTips =
             `<div id="${ELEMENTS.TIPS_CONTAINER.replace('#', '')}" class="table-responsive" style="margin-top: 20px; text-align: left;">
                <table class="nationtable"></table>
              </div>`;

            var dangerOptions =
             `<hr />
              <div class="btn-group pull-right" style="margin: 0 0 15px 15px;">
                <button type="button" class="btn btn-danger dropdown-toggle" data-toggle="dropdown">Reset Options <span class="caret"></span></button>
                <ul class="dropdown-menu">
                  <li><a href="#" id="${ELEMENTS.RESET_TIPS_BUTTON.replace('#', '')}">Reset Tips Table</a></li>
                </ul>
              </div>`;

            var configOptions =
             `<div class="btn-group pull-right" style="margin: 0 0 15px 0;">
                <button type="button" class="btn btn-default dropdown-toggle" data-toggle="dropdown">Config Options <span class="caret"></span></button>
                  <ul class="dropdown-menu">
                    <li><a href="#" id="${ELEMENTS.HIGHLIGHT_ALLIANCE_IDS_BUTTON.replace('#', '')}">Highlight Alliance IDs</a></li>
                  </ul>
              </div>`;

            return tableTips + dangerOptions + configOptions;
        }

        // after appending htmlTipsTables to DOM, use that to bind events
        function eventsAfterAppend() {
            $(ELEMENTS.RESET_TIPS_BUTTON).click(function(event) {
                event.preventDefault();
                database.cleanTipsInfo();
                reloadTipsTable();
            });

            $(ELEMENTS.HIGHLIGHT_ALLIANCE_IDS_BUTTON).click(function(event) {
                event.preventDefault();
                var allianceIds = database.getHighligthAllianceIds().join(',');
                var newAllianceIds = window.prompt('Write down alliance IDs separated by commas to highlight them in the table (eg: \'1584,9999,8888\').', allianceIds);

                if (!newAllianceIds) {
                    return;
                }

                var newArrayAllianceIds = newAllianceIds.split(',');
                newArrayAllianceIds = newArrayAllianceIds.map(numStr => parseInt(numStr));

                database.setHighligthAllianceIds(newArrayAllianceIds);
                reloadTipsTable();
            });

            reloadTipsTable();
        }
    }

    function PageQuery() {
        this.playHostGame = playHostGame;
        this.verifyHostGame = verifyHostGame;
        this.historyMatches = historyMatches;
        this.matchEarnings = matchEarnings;
        this.nationInfo = nationInfo;
        this.getTokenFromPage = getTokenFromPage;
        this.playAwayGame = playAwayGame;
        this.checkCurrentGamesNumber = checkCurrentGamesNumber;
        this.verifyAwayGame = verifyAwayGame;
        this.cancelHostGame = cancelHostGame;

        async function cancelHostGame(tokenVal) {
            var request = {};
            request.token = tokenVal;
            request.cancelhomegame = 'Cancel+Home+Game';

            var htmlPageResponse = await $.post('/obl/host/', request);
            return htmlPageResponse;
        }

        async function playHostGame(tokenVal) {
            // make post to page simulating a click
            var request = {
                token: tokenVal,
                submithomegame: 'Host+Home+Game'
            };

            var htmlPageResponse = await $.post('/obl/host/', request);
            return htmlPageResponse;
        }

        async function _checkCaptcha(htmlPageText, playAudio) {
            var isCaptchaFound = htmlPageText.search('<meta http-equiv="REFRESH" content="0;url=https://politicsandwar.com/human/">') >= 0;

            if (isCaptchaFound) {
                // play a sound and reload
                if (playAudio) {
                    SOUNDS.ELETRONIC_CHIME.play();
                    await HELPER.timeout(1000);
                }

                // redirect to captcha page
                window.location.replace('/human/');
                await HELPER.timeout(1000);
                throw 'Captcha is blocking baseball.';
            }
        }

        async function verifyHostGame(htmlPageText, playAudio) {
            _checkCaptcha(htmlPageText, playAudio);

            var extractResults = {
                tryAgain: true,
                htmlText: null
            };

            var isSearchFound = htmlPageText.search('You are already hosting a home game. Wait for someone to play your team first before starting another.') >= 0
            || htmlPageText.search('You are currently already hosting a game and awaiting a match.') >= 0
            || htmlPageText.search('You have successfully opened up your Stadium and readied your team to play a home game.') >= 0
            || htmlPageText.search('We\'re sorry, the Politics and War server is under heavy load currently. Check back in about half a minute and things should be good to go. Thanks!') >= 0
            || htmlPageText.search('Want to learn more about why some game pages are currently unavailable?') >= 0;

            if (isSearchFound) {
                extractResults.htmlText = await $.get('/obl/host/');
                extractResults.tryAgain = true;
                return extractResults;
            }

            // if it's already played, no need for fetching more
            extractResults.tryAgain = false;
            extractResults.htmlText = htmlPageText;

            return extractResults;
        }

        async function historyMatches(teamId, lastMatchId, playAudio) {
            var extractResult = {
                tryAgain: true,
                matchIds: []
            };

            var htmlHistoryPage = await $.get('/obl/history/team/id=' + teamId);

            _checkCaptcha(htmlHistoryPage, playAudio);

            var historyPageJquery = $($.parseHTML(htmlHistoryPage));
            var linkNationElement = historyPageJquery.find('#rightcolumn > h1 > a:eq(0)');
            var yourNationId = linkNationElement.attr('href').match(/\d+/g)[0];

            // grab match id
            var elementsMatchId = historyPageJquery.find('#rightcolumn table td a:contains("View")');
            var newMatch = null;

            if (!lastMatchId) {
                // just grab one when we are starting or not have that info
                newMatch = _populateMatchsArray(lastMatchId, yourNationId, elementsMatchId, 0);
                if (newMatch) {
                    extractResult.matchIds.push(newMatch);
                }
            } else {
                // Loop is needed for more than one because we can start hosting a game, close browser
                // and after some time the game gets played and program was not running and lost track of it.

                // backwards loop
                for(var m = (elementsMatchId.length - 1); m >= 0; m--) {
                    newMatch = _populateMatchsArray(lastMatchId, yourNationId, elementsMatchId, m);
                    if (newMatch) {
                        extractResult.matchIds.push(newMatch);
                    }
                }
            }

            extractResult.tryAgain = false;
            return extractResult;
        }

        // populate match array with info
        function _populateMatchsArray(lastMatchId, nationId, elementsMatchId, index) {
            lastMatchId = lastMatchId || 0;

            // just grab one when we are starting or not have that info
            var hrefMatchId = elementsMatchId.eq(index).attr('href');
            var matchId = hrefMatchId.match(/\d+/g)[0];

            var hostTdHref = elementsMatchId.eq(index).parent().parent().find('td:eq(4) > a:eq(0)').attr('href');
            var hostTeamNationId = hostTdHref.match(/\d+/g)[0];

            var isHomeGame = hostTeamNationId === nationId;

            if (lastMatchId < matchId) {
                return { matchId: matchId, isHomeGame: isHomeGame };
            }

            return null;
        }

        async function matchEarnings(firstMatchObj, playAudio) {
            var htmlMatchPage = await $.get('/obl/game/id=' + firstMatchObj.matchId);

            _checkCaptcha(htmlMatchPage, playAudio);

            // grab nation id and earnings
            var pageElement = $($.parseHTML(htmlMatchPage));

            var winElement = pageElement.find('#rightcolumn .nationtable th:contains("Winner\'s Earnings")');
            var tdElements = winElement.parent().next().find('td');
            var winningMoney = parseFloat(tdElements.eq(0).text().replace('$', '').replace(/,/g, ''));
            var hostMoney = parseFloat(tdElements.eq(1).text().replace('$', '').replace(/,/g, ''));

            var nationLinks = pageElement.find('#rightcolumn .nationtable td h1 a');
            var hrefLink = nationLinks.eq(firstMatchObj.isHomeGame ? 0 : 1).attr('href');
            var nationId = hrefLink.match(/\d+/g)[0];

            var matchInfo = {
                nationId: nationId,
                matchId: firstMatchObj.matchId,
                isHomeGame: firstMatchObj.isHomeGame,
                winningMoney: winningMoney,
                hostMoney: hostMoney
            };

            return matchInfo;
        }

        async function nationInfo(matchInfo) {
            var htmlNationPage = await $.get('/nation/id=' + matchInfo.nationId);

            var pageElement = $($.parseHTML(htmlNationPage));
            var nationNameTitleTd = pageElement.find('#rightcolumn .nationtable td:contains("Nation Name:")');
            var nationName = nationNameTitleTd.next().text().trim();
            matchInfo.nationName = nationName;

            var allianceNameTitleTd = pageElement.find('#rightcolumn .nationtable td:contains("Alliance:")');
            var allianceLinkElement = allianceNameTitleTd.next().find('a');

            var allianceName = 'None';
            var allianceId = null;

            if (allianceLinkElement.length > 0) {
                allianceName = allianceLinkElement.text().trim();
                var allianceHref = allianceLinkElement.attr('href');
                allianceId = allianceHref.match(/\d+/g)[0];
            }

            matchInfo.allianceId = allianceId;
            matchInfo.allianceName = allianceName;

            return matchInfo;
        }

        function checkCurrentGamesNumber(textHtmlAwayPage) {
            var availableTextMatcher = textHtmlAwayPage.match(/There are currently (\d+) matches available/g);
            var availableText = availableTextMatcher[0];
            var numberMatcher = availableText.match(/\d+/g);
            var resultGames = numberMatcher[0];

            return parseInt(resultGames);
        }

        function getTokenFromPage(textHtmlAwayPage) {
            var tokenInput = $($.parseHTML(textHtmlAwayPage)).find('#rightcolumn input[name="token"]');

            if (!tokenInput.length) {
                return;
            }

            var tokenVal = $(tokenInput[0]).val();
            return tokenVal;
        }

        async function playAwayGame(tokenVal) {
            // make post to page simulating a click
            var request = {
                token: tokenVal,
                submitawaygame: 'Play+Away+Game'
            };

            var htmlPageResponse = await $.post('/obl/play/', request);
            return htmlPageResponse;
        }

        async function verifyAwayGame(htmlAwayPage, playAudio) {
            _checkCaptcha(htmlAwayPage, playAudio);

            var extractResult = {
                tryAgain: true,
                tokenVal: null,
                gamesQuantity: 0,
                htmlText: htmlAwayPage,
                isGamePlayed: false
            };

            var isHeavyLoad = htmlAwayPage.search('We\'re sorry, the Politics and War server is under heavy load currently. Check back in about half a minute and things should be good to go. Thanks!') >= 0
            || htmlAwayPage.search('Want to learn more about why some game pages are currently unavailable?') >= 0;

            if (isHeavyLoad) {
                extractResult.tryAgain = true;
                extractResult.htmlText = await $.get('/obl/play/');
                return extractResult;
            }

            var isGamePlayed = htmlAwayPage.search('Game Results') >= 0 && htmlAwayPage.search('Winner\'s Earnings') >= 0 && htmlAwayPage.search('Home Team Revenue');
            extractResult.isGamePlayed = isGamePlayed;

            var gamesNumber = checkCurrentGamesNumber(htmlAwayPage);

            extractResult.gamesQuantity = gamesNumber;

            if (gamesNumber == 0) {
                extractResult.tryAgain = true;
                extractResult.htmlText = await $.get('/obl/play/');
                return extractResult;
            }

            // if it's here, there is away games to play
            extractResult.tokenVal = getTokenFromPage(htmlAwayPage);
            extractResult.htmlText = htmlAwayPage;
            extractResult.tryAgain = false;
            return extractResult;
        }

    }

    function Database() {
        // private vars //
        var objectDatabase;

        // public vars //
        this.reset = reset;
        this.write = write;

        this.addTipsInfo = addTipsInfo;
        this.getTipsInfo = getTipsInfo;

        this.cleanTipsInfo = cleanTipsInfo;
        this.addNationTips = addNationTips;
        this.removeNationTips = removeNationTips;
        this.getLastMatchId = getLastMatchId;

        this.getConfigSortTableTips = getConfigSortTableTips;
        this.setConfigSortTableTips = setConfigSortTableTips;

        this.getHighligthAllianceIds = getHighligthAllianceIds;
        this.setHighligthAllianceIds = setHighligthAllianceIds;

        // construct //
        reset();

        // methods //
        function reset() {
            var database = window.localStorage.getItem('database');

            if (!database) {
                // reset database with default values
                objectDatabase = {};
            } else {
                objectDatabase = JSON.parse(window.localStorage.getItem('database'));
            }

            // default values when not filled
            objectDatabase.tipsBecauseHost = objectDatabase.tipsBecauseHost || [];
            objectDatabase.lastMatchId = objectDatabase.lastMatchId || 0;
            objectDatabase.config = objectDatabase.config || {};
            objectDatabase.config.sortTipsTable = objectDatabase.config.sortTipsTable || 'nationName';
            objectDatabase.config.highlightAllianceIds = objectDatabase.config.highlightAllianceIds || [];

            write();
        }

        function write() {
            objectDatabase.version = VERSION;
            window.localStorage.setItem('database', JSON.stringify(objectDatabase));
        }

        function addTipsInfo(matchInfo) {
            var nationFound = objectDatabase.tipsBecauseHost.find((tip) => matchInfo.nationId === tip.nationId);

            var addAtEnd = false;

            if (!nationFound) {
                addAtEnd = true;

                nationFound = {};
                nationFound.nationId = matchInfo.nationId;
                nationFound.moneyDeserved = 0;
            }

            nationFound.nationName = matchInfo.nationName;
            nationFound.allianceId = matchInfo.allianceId;
            nationFound.allianceName = matchInfo.allianceName;

            var hostMoney = matchInfo.hostMoney * 0.3;
            if ( ! matchInfo.isHomeGame ) {
                // away games grab
                hostMoney = -hostMoney;
            }

            nationFound.moneyDeserved = HELPER.roundUp(nationFound.moneyDeserved + hostMoney, 2);

            if (addAtEnd) {
                objectDatabase.tipsBecauseHost.push(nationFound);
            }

            // add last match id
            objectDatabase.lastMatchId = Math.max(matchInfo.matchId, objectDatabase.lastMatchId);

            write();
        }

        function getTipsInfo() {
            return objectDatabase.tipsBecauseHost;
        }

        function cleanTipsInfo() {
            objectDatabase.tipsBecauseHost = [];
            objectDatabase.lastMatchId = 0;
            write();
        }

        function getNationTips(nationId) {
            return objectDatabase.tipsBecauseHost.find((tip) => tip.nationId === nationId);
        }

        function removeNationTips(nationId) {
            objectDatabase.tipsBecauseHost = objectDatabase.tipsBecauseHost.filter((tip) => tip.nationId !== nationId);
            write();
        }

        function addNationTips(nationId, money) {
            var nationFound = objectDatabase.tipsBecauseHost.find((tip) => nationId === tip.nationId);
            nationFound.moneyDeserved = HELPER.roundUp(nationFound.moneyDeserved + parseFloat(money), 2);
            write();
        }

        function getLastMatchId() {
            return objectDatabase.lastMatchId;
        }

        function setConfigSortTableTips(sortOption) {
            if (!objectDatabase.config) {
                objectDatabase.config = {};
            }

            objectDatabase.config.sortTipsTable = sortOption;
            write();
        }

        function getConfigSortTableTips() {
            if (objectDatabase.config) {
                return objectDatabase.config.sortTipsTable;
            }

            return null;
        }

        function getHighligthAllianceIds() {
            if (objectDatabase.config) {
                return objectDatabase.config.highlightAllianceIds;
            }

            return null;
        }

        function setHighligthAllianceIds(intArray) {
            if (!objectDatabase.config) {
                objectDatabase.config = {};
            }

            objectDatabase.config.highlightAllianceIds = intArray;
            write();
        }
    }

    function HelperFunctions() {
        this.timeout = timeout;
        this.sleep = sleep;
        this.roundUp = roundUp;

        // generic helper functions
        function timeout(ms) {
            return new Promise(resolve => setTimeout(resolve, ms));
        }

        async function sleep(fn, miliseconds, ...args) {
            await timeout(miliseconds);
            return fn(...args);
        }

        function roundUp(num, precision) {
            var precision100 = Math.pow(10, precision);
            var roundingUp = Math.ceil(num * precision100) / precision100;
            return parseFloat(roundingUp.toFixed(precision));
        }
    }
})();